import {
  Card,
  CardContent,
  Typography,
  CardActions,
  Button,
} from "@mui/material";

function Notifications(props) {
  return (
    <>
      {props.content.map((notification, index) => (
        <Card key={index}>
          <CardContent>
            <Typography variant="body2">{notification.content}</Typography>
          </CardContent>
        </Card>
      ))}
    </>
  );
}
export default Notifications;
